	<div className={styles.wrapper}>
		<div className={styles.dim} />
		<aside className={styles.popup}>
			<button type="button" onClick={handleClose} className={styles.close}>
				√ó
			</button>
			{RichText.render(content)}
		</aside>
	</div>
);
